package com.muyer.Q400_500;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

/**
 *@描述
 *@创建人 yejiang
 *@创建时间 2022/9/16 18:07
 */
public class Q438_找到字符串中所有字母异位词 {

    public static void main(String[] args) {
        findAnagrams(
                ""
                ,
                "");
    }
    public static List<Integer> findAnagrams(String s, String p) {
        System.out.println(s.length());
        System.out.println(p.length());
        if(s.length() < p.length()) {
            return new ArrayList<>();
        }
        Map<Character,Integer> countMap = new HashMap<>();
        //初始化窗口范围的统计
        Map<Character,Integer> countMap2 = new HashMap<>();
        for(int i=0 ; i<p.length() ; i++){
            char c = p.charAt(i);
            char c1 = s.charAt(i);
            countMap.put(c,countMap.containsKey(c) ? 1 + countMap.get(c) : 1);
            countMap2.put(c1,countMap2.containsKey(c1) ? 1 + countMap2.get(c1) : 1);
        }
        System.out.println(countMap.get('a'));
        System.out.println(countMap2.get('a'));
        List<Integer> res = new ArrayList<>();
        int left = 0;
        int right = p.length() - 1;
        while(right < s.length()){
            if(isAnagrams(countMap,countMap2)){
                res.add(left);
            }
            left++;
            right++;
            //处理变化的字符
            if(right >= s.length()){
                break;
            }
            char leftChar = s.charAt(left-1);
            char rightChar = s.charAt(right);
            countMap2.put(leftChar,countMap2.get(leftChar) - 1);
            countMap2.put(rightChar,countMap2.containsKey(rightChar) ? 1 + countMap2.get(rightChar) : 1);
        }
        return res;
    }

    public static boolean isAnagrams(Map<Character,Integer> countMap,Map<Character,Integer> countMap2){
        for(Character key : countMap.keySet()){
            if(!countMap.get(key).equals(countMap2.get(key))){
                return false;
            }
        }
        return true;
    }
}
